import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  container: {
    padding: 16,
    marginTop: 100,
    marginHorizontal: 24,
    backgroundColor: "#640635",
    borderRadius: 8,
    elevation: 4,
    shadowColor: "#000",
    shadowOffset: { width: 0, height: 2 },
    shadowRadius: 6,
    shadowOpacity: 0.25,
  },

  inpParent: {
    flexDirection: "row",
    justifyContent: "center",
    marginVertical: 8,
  },

  inp: {
    height: 50,
    width: 70,
    fontSize: 32,
    borderBottomColor: "#ddb52f",
    borderBottomWidth: 2,
    color: "#ddb52f",
    fontWeight: "bold",
    textAlign: "center",
  },

  buttonsParent: {
    marginVertical: 10,
    flexDirection: "row",
    justifyContent: "space-around",
    width: 225,
    marginLeft: "auto",
    marginRight: "auto",
  },
});
